import { ApiProperty } from '@nestjs/swagger';

abstract class ProfileModel {
  @ApiProperty({
    description: '핸드폰 번호',
    required: true,
  })
  public phoneNumber: string;

  @ApiProperty({
    description: 'QR 코드',
    required: true,
    example: 'data:image/png;base64,'
  })
  public qrCode: string;
}

export default ProfileModel;